import React from 'react'
import {useState} from 'react';
import Footer from '../components/home/Footer';
import Header from '../components/home/Header';
import HeaderNav from '../components/common/HeaderNav'


export default function MinifyCSS(){

    const [formdata, setformdata] = useState('');

    const handleSubmit = event => {
        console.log('handleSubmit ran');
        event.preventDefault();
    }

    const onSubmit = (data) => {
        console.log(data);
    }

    return(<div>
        <HeaderNav />
        <div class="tools-for-better-thinking">
            <div class="container-fluid row col-md-12">
            <div class="col-md-6">
            <label class="my-1 mr-2" for="inlineFormCustomSelectPref"><h2>Input CSS Code</h2></label>
            <form role="form" onSubmit={setformdata(onSubmit)}>
                <div class="form-group">
                <textarea class="form-control" rows="15" id="input-comment" ref={formdata}></textarea>
                </div>
                    <button type="submit" class="btn btn-primary" id="formdata">Minify CSS</button>
            </form>
                </div>
                <div class="col-md-6">
            <label class="my-1 mr-2" for="inlineFormCustomSelectPref"><h2>Result</h2></label>
            <form role="form2">
                <div class="form-group">
                <textarea class="form-control" rows="15" id="output-comment"></textarea>
                </div>
                    <button type="submit" class="btn btn-primary" id="copy-all">copy</button>

            </form>
                </div>
            </div>
        </div>
        <Footer />
    </div>)
}
